Q_Tank.GetTempData = function (key, strName)
                             if not Q_Tank[key] or not Q_Tank_index[strName] or type(key) == "function" then
                                    log_info("Q_Tank.log"," the data is nil or the index data is nil or key is function key =%s , strName = %s" , tostring(key) , tostring( strName))
                                    return nil
                             end
                             if type(Q_Tank[key]) ~= "table" then
                                    log_info("Q_Tank.log"," the data is not table key =%s , strName = %s" , tostring(key) , tostring( strName))
                                return nil
                             end
                             local pData = Q_Tank[key][Q_Tank_index[strName]]
                             if not pData then
                                 log_info("Q_Tank.log"," the data is nil key =%s , strName = %s" , tostring(key) , tostring( strName))
                                 return nil
                             end
                             return pData
                         end
